import "./App.css";
import About from "./Components/About/About";
import Landing from "./Components/LandingPage/Landing";
import AOS from "aos";

function App() {
  // const scrollToDiv = (ref) => window.scrollTo(0, ref.current.offsetTop);
  // const el1 = useRef();
  // const el2 = useRef();

  useEffect(() => {
    AOS.init();
  }, []);

  return (
    <div className="bgImage">
      <div className="bgBlack overflow-scroll">
        <Landing />
        <About />
        <Landing />
      </div>
    </div>
  );
}

export default App;
